import React from "react";
import Button from "../../../../../components/Button";
import checkIcon from "../../../../../public/assets/icons/Check.png";

const PricingItem = () => {
  return (
    <div className="py-4 px-4 border w-[22em] bg-[#1E1E1E]">
      <div className="flex items-center justify-between">
        <div className="w-[3em] h-[3em] rounded-full border-4 border-white"></div>
        <div className="p-1 border-2 rounded-lg border-green-600">
          Individual
        </div>
      </div>
      <h1 className="mt-12 text-4xl">Starter</h1>
      <p className="text-gray-200 text-sm">
        Experience Kode!'s core features for free.
      </p>
      <h1 className="mt-10 text-5xl">Free</h1>
      <p className="text-[#808080]">Suited for Beginners and Explorers.</p>
      <Button className="border-2 border-[#4F4F4F] bg-transparent mt-6">
        <p className="font-normal text-xl text-center ">Get Started for Free</p>
      </Button>
      <div className="mt-6">
        <div className="flex items-center gap-2">
          <img src={checkIcon} />
          <p className="text-sm w-full">Access to a limited number of competitions per month</p>
        </div>
      </div>
    </div>
  );
};

export default PricingItem;
